import React from 'react';
import { Link } from 'react-router-dom';

function AllProfile() {
  return (
    <div>
      <button className='bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded-full'>
        Profile
      </button>
      <button className='bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded-full'>
        Payment Details
      </button>
    </div>
  );
}

export default AllProfile;
